import React from "react";

const HighScore = (props) => {
  return (
    <div>
      <h1>High Score per Country</h1>
      {props.scores.map((x) => (
        <div><p></p>High Scores:{x.name}</div>
      ))}
    </div>
  );
};

export default HighScore;
